@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix atm: <http://lod.csd.auth.gr/atm/atm.ttl#> .

atm:BankCode a owl:Class .

atm:ValidBankCode a owl:Class ;
    rdfs:subClassOf atm:BankCode .

atm:InvalidBankCode a owl:Class ;
    rdfs:subClassOf atm:BankCode .

atm:returnsCode a rdf:Property ;
    rdfs:domain atm:ATM ;
    rdfs:range atm:BankCode .
